import React from 'react';
import Button from '@material-ui/core/Button';

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          #Which Celeb Is You?
        </p>
        <Button>
          Start Test
        </Button>
      </header>
    </div>
  );
}

export default App;
